import React, { useState } from 'react';
import { Link } from 'react-router-dom';

export default function PropertyCard({ listing }) {
  const [fav, setFav] = useState(false);
  return (
    <div
      className="property-card"
      style={{
        position: 'relative',
        border: 'none',
        boxShadow: '0 6px 24px rgba(40,60,120,0.10)',
        transition: 'box-shadow 0.2s, transform 0.18s',
        borderRadius: 20,
        overflow: 'hidden',
        background: '#fff',
        cursor: 'pointer',
        willChange: 'transform',
      }}
      tabIndex={0}
      aria-label={`View details for ${listing.title}`}
      onMouseOver={e => e.currentTarget.style.transform = 'translateY(-8px) scale(1.03)'}
      onMouseOut={e => e.currentTarget.style.transform = 'none'}
    >
      <div style={{ position: 'relative' }}>
        <img
          src={listing.images[0]}
          alt="property"
          style={{
            width: '100%',
            height: 200,
            objectFit: 'cover',
            borderTopLeftRadius: 16,
            borderTopRightRadius: 16,
            transition: 'transform 0.34s cubic-bezier(.22,1,.36,1)',
          }}
          onMouseOver={e => e.currentTarget.style.transform = 'scale(1.07)'}
          onMouseOut={e => e.currentTarget.style.transform = 'scale(1)'}
        />
        {/* Gradient overlay for readability */}
        <div style={{
          position: 'absolute',
          left: 0,
          right: 0,
          bottom: 0,
          height: '40%',
          background: 'linear-gradient(0deg,rgba(25,118,210,0.17) 0%,rgba(255,255,255,0.01) 100%)',
        }} />
        {/* Favorite heart button */}
        <button
          aria-label={fav ? 'Remove from favorites' : 'Add to favorites'}
          onClick={e => {
            e.preventDefault();
            setFav(f => !f);
          }}
          style={{
            position: 'absolute',
            top: 16,
            left: 16,
            zIndex: 3,
            background: fav ? '#c09a5b' : 'rgba(255,255,255,0.95)',
            border: 'none',
            borderRadius: '50%',
            width: 38,
            height: 38,
            boxShadow: '0 2px 8px rgba(25,118,210,0.11)',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            cursor: 'pointer',
            transition: 'background 0.19s',
            outline: fav ? '2.5px solid #c09a5b' : 'none',
          }}
        >
          <svg width="22" height="22" viewBox="0 0 24 24" fill={fav ? '#fff' : 'none'} stroke={fav ? '#fff' : '#c09a5b'} strokeWidth="2.2" strokeLinecap="round" strokeLinejoin="round">
            <path d="M12 21C12 21 4 13.86 4 8.5C4 5.42 6.42 3 9.5 3C11.24 3 12.91 3.81 14 5.08C15.09 3.81 16.76 3 18.5 3C21.58 3 24 5.42 24 8.5C24 13.86 16 21 16 21H12Z" />
          </svg>
        </button>
        {/* Price badge */}
        <span style={{
          position: 'absolute',
          top: 14,
          right: 14,
          background: 'rgba(25,118,210,0.95)',
          color: '#fff',
          borderRadius: 8,
          padding: '6px 14px',
          fontWeight: 600,
          fontSize: 16,
          boxShadow: '0 2px 8px rgba(25,118,210,0.13)',
        }}>
          ${listing.price} <span style={{ fontWeight: 400, fontSize: 13 }}>/night</span>
        </span>
        {/* Superhost badge (mocked) */}
        {listing.host?.isSuperhost && (
          <span style={{
            position: 'absolute',
            bottom: 18,
            left: 18,
            background: '#fffbe6',
            color: '#c09a5b',
            borderRadius: 7,
            padding: '3px 10px',
            fontWeight: 700,
            fontSize: 13,
            boxShadow: '0 1px 4px rgba(192,154,91,0.11)',
            letterSpacing: '0.03em',
          }}>Superhost</span>
        )}
      </div>
      <Link to={`/listing/${listing._id}`} style={{ textDecoration: 'none', color: 'inherit' }}>
        <div className="property-info" style={{ padding: '1.2rem', minHeight: 120 }}>
          <h3 style={{ marginBottom: 6, fontFamily: 'Playfair Display, serif', fontWeight: 700 }}>{listing.title}</h3>
          <div style={{ color: '#1976d2', fontWeight: 500, marginBottom: 2 }}>{listing.location}</div>
          {/* Rating stars (mocked) */}
          <div style={{ display: 'flex', alignItems: 'center', margin: '6px 0 4px 0' }}>
            {[1,2,3,4,5].map(i => (
              <svg key={i} width="18" height="18" viewBox="0 0 24 24" fill={i<=4 ? '#c09a5b' : 'none'} stroke="#c09a5b" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round" style={{ marginRight: 2 }}>
                <polygon points="12 2 15.09 8.26 22 9.27 17 14.14 18.18 21.02 12 17.77 5.82 21.02 7 14.14 2 9.27 8.91 8.26 12 2" />
              </svg>
            ))}
            <span style={{ color: '#c09a5b', fontWeight: 600, marginLeft: 6, fontSize: 15 }}>4.9</span>
          </div>
          <div style={{ color: '#888', fontSize: 14, marginTop: 8 }}>
            Host: {listing.host?.name || 'Unknown'}
          </div>
        </div>
      </Link>
    </div>
  );
}
